import styled from 'styled-components';


const FooterStyle = styled.div`
background-color: #0F1C51;
padding-top:15%;
.img{
    width: 5%;
    margin: 0 auto;
    margin-bottom:5%;
}
.contact{
    margin: 0 auto;
    margin-top:10%;
}
`;

export { FooterStyle };
